const ActivationPage = () => {
    return (
        <div style={{ textAlign: 'center', padding: '20px' }}>
            <h1>Bienvenue sur la page d'activation !</h1>
            <p>Veuillez entrer votre code d'activation ci-dessous :</p>
            <input type="text" placeholder="Code d'activation" />
            <button style={{ marginTop: '10px' }}>Activer</button>
        </div>
    );
};

export default ActivationPage;
